import React from "react";
import '../App.css'

const Navabar = () => {
  return (
    <div className="navabar">
      <h1>Shopping App</h1>
      <button class="login-button">Войти</button>
      <button class="cart-button">Корзина</button>
    </div>
  );
};

export default Navabar;
